export default function CryptoSuggestions() {
  const coins = [
    "BINANCE:BTCUSDT",
    "BINANCE:ETHUSDT",
    "BINANCE:BNBUSDT",
    "BINANCE:SOLUSDT",
    "BINANCE:XRPUSDT",
    "BINANCE:DOGEUSDT",
    "BINANCE:ADAUSDT",
  ];

  return (
    <div>
      <h2>ðŸ”¥ Popular Crypto Symbols</h2>
      {coins.map((c) => (
        <div
          key={c}
          style={{
            padding: 6,
            margin: "4px 0",
            background: "#ddd",
            borderRadius: 4,
            width: "fit-content",
          }}
        >
          {c}
        </div>
      ))}
    </div>
  );
}
